import { Switch, Route, Redirect } from "react-router-dom";
import Home from "./components/pages/Home";
import SignUp from "./components/pages/SignUp";
import SignIn from "./components/pages/SignIn";
import Main from "./components/layout/Main";
import Profile from "./components/pages/Profile";
import Membeers from "./components/pages/Member";

import TaskList from "./components/Masters/TaskList";
import TeamList from "./components/Masters/TeamsList";

import "antd/dist/antd.css";
import "./assets/styles/main.css";
import "./assets/styles/responsive.css";

function App() {
  const token = sessionStorage.getItem("token");
  return (
    <div className="App">
      <Switch>
        {/* Redirect to home page if user is logged in */}
        <Route path="/sign-up" exact render={() => (token ? <Redirect to="/home" /> : <SignUp />)} />
        <Route path="/sign-in" exact render={() => (token ? <Redirect to="/home" /> : <SignIn />)} />

        <Redirect from="*" to="/sign-in" />
        <Main>
          {/* <Route exact path="/dashboard" component={Home} /> */}
          <Route path="/home" component={Home} />
          <Route exact path="/tasks" component={TaskList} />
          <Route exact path="/teams" component={TeamList} />
          <Route exact path="/profile" component={Profile} />
          <Route exact path="/members" component={Membeers} />

        </Main>
      </Switch>
    </div>
  );
}

export default App;
